import React from 'react';
import './assets/css/index.css';
import SideBreak from "./components/SideBreak";
import Knowledge from "./components/Knowledge"
import Banner from "./components/Banner";
import Projects from "./components/Projects";
import Companies from "./components/Companies";
import Resume from "./components/Resume";
import Footer from "./components/Footer";
import AboutMe from "./components/AboutMe";
import Zoom from 'react-reveal/Zoom';
import Fade from "react-reveal/Fade";
import {Parallax, ParallaxLayer} from 'react-spring/renderprops-addons'






function App() {
  return (
    <div className="App">
        <Parallax pages={3} scrolling={false} horizontal ref={ref => (this.parallax = ref)}>
            <ParallaxLayer offset={0} speed={0.5}>
                <Banner/>
            </ParallaxLayer>
        </Parallax>
        <SideBreak header={"Hi, I'm Simon. Nice to meet you!"} paragraph={"Since beginning my journey as a freelance designer nearly 8 years ago, I've done remote work for agencies, consulted for startups, and collaborated with talented people to create digital products for both business and consumer use. I'm quietly confident, naturally curious, and perpetually working on improving my chops one design problem at a time."}/>
        <Fade bottom><Knowledge/></Fade>
        <Fade><Projects/></Fade>
        <Fade><Companies/></Fade>
        <SideBreak header={"This is my history"} paragraph={"Since I started studies towards computer science i accomplished a lot. Interests have grown and some others faded. But some all in all I have learned that it is always a pleasure to work with coding of any kind!"}/>
        <Zoom><Resume/></Zoom>
        <AboutMe/>
        <Footer/>
    </div>
  );
}

export default App;
